		/**
		 * enp solution
		 * fire eventCallback always even when googletagmanager is broken
		 */
		var oldDataLayerPush = dataLayer.push;
		dataLayer.push = function (obj) {
			var googleEventDone = false;
			var enpEventDone = false;

			if (typeof obj.eventCallback === 'function') {

				var previousEventCallback = obj.eventCallback;
				obj.eventCallback = function () {
					if (enpEventDone === false) {
						googleEventDone = true;
						console.log('google event has been terminated remotely !');
						previousEventCallback();
					}
				};
			}

			oldDataLayerPush.apply(this, [obj]);

			if (typeof previousEventCallback === 'function') {
				setTimeout(function () {
					if (googleEventDone === false) {
						enpEventDone = true;
						console.log('ENP chack after 100 ms : google event has NOT been terminated remotely ! enp do redirect');
						previousEventCallback();
					}
				}, 100);
			}
		}
	</script>



